INSERT INTO `libros` (`id`, `titulo`, `portada`, `descripcion`, `autores_id`, `cantidad`) VALUES
(1, 'Harry Potter y la Piedra Filosofal', , 'Harry Potter crece en la casa de sus tios, los Dursley, quienes le ocultan su verdadera historia familiar; al cumplir Harry once anos de edad, empiezan a llegarle cartas de remitente desconocido, que van aumentando en numero a medida que sus tios no dejan que las abra. Las mismas traen la noticia de que el nino ha sido admitido en el Colegio Hogwarts de Magia y Hechiceria, ya que, al igual que sus padres, tiene poderes magicos.\r\n\r\n\r\nEl Colegio Hogwarts es el principal escenario donde suceden los hechos de la serie de novelas.\r\nSe descubre entonces que los Potter no murieron en un accidente de coche como se le habia dicho a Harry, sino que habian sido asesinados en la noche de Halloween por un hechicero tenebroso conocido como lord Voldemort, quien habia aterrorizado a la comunidad magica britanica anos atras. Sin embargo, algo ocurrio esa noche: Voldemort consiguio matar al matrimonio Potter pero no pudo asesinar al bebe, perdio su cuerpo y le dejo al nino una cicatriz permanente en forma de rayo en su frente.\r\n\r\nRubeus Hagrid aparece para llevarse a Harry una noche, cuando los Dursley intentan impedir que parta rumbo al colegio. Mas tarde, el hombre ayuda a Harry a comprar sus materiales escolares en el Callejon Diagon y alli este descubre que es famoso entre los magos por haber sobrevivido al intento de homicidio. Posteriormente, el muchacho toma el tren que lo lleva a Hogwarts y alli conoce a Ronald Weasley, un chico pelirrojo hijo de magos, y a Hermione Granger, una jovencita de origen muggle con altas aspiraciones academicas. Los tres se hacen amigos y mas tarde, durante su ano escolar, se ven envueltos en una serie de episodios relacionados con un objeto escondido en las profundidades del edificio: la piedra filosofal, un artefacto con el poder de transmutar los metales en oro y producir el elixir de la vida eterna. Diferentes hechos les hacen suponer que uno de sus profesores, Severus Snape, desea conseguir la piedra para entregarsela a Voldemort, con quien el docente estaria confabulado.', 2, 5);
INSERT INTO `libros` (`id`, `titulo`, `portada`, `descripcion`, `autores_id`, `cantidad`) VALUES
(2, 'Hamlet', , 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.', 4, 4);
INSERT INTO `libros` (`id`, `titulo`, `portada`, `descripcion`, `autores_id`, `cantidad`) VALUES
(3, 'Don Quijote de la Mancha', , 'Don Quijote de la Mancha es una novela escrita por el espanol Miguel de Cervantes Saavedra. Publicada su primera parte con el titulo de El ingenioso hidalgo don Quijote de la Mancha a comienzos de 1605, es la obra mas destacada de la literatura espanola y una de las principales de la literatura universal. En 1615 aparecio su continuacion con el titulo de Segunda parte del ingenioso caballero don Quijote de la Mancha. El Quijote de 1605 se publico dividido en cuatro partes; pero al aparecer el Quijote de 1615 en calidad de Segunda parte de la obra, quedo revocada de hecho la particion en cuatro secciones del volumen publicado diez anos antes por Cervantes\r\n\r\nEs la primera obra genuinamente desmitificadora de la tradicion caballeresca y cortes por su tratamiento burlesco. Representa la primera novela moderna y la primera novela polifonica; como tal, ejercio un enorme influjo en toda la narrativa europea. Por considerarse el mejor trabajo literario jamas escrito, encabezo la lista de las mejores obras literarias de la historia, que se establecio con las votaciones de cien grandes escritores de 54 nacionalidades a peticion del Club Noruego del Libro en 2002; asi, fue la unica excepcion en el estricto orden alfabetico que se habia dispuesto.', 1, 6);
INSERT INTO `libros` (`id`, `titulo`, `portada`, `descripcion`, `autores_id`, `cantidad`) VALUES
(4, 'Harry Potter y el caliz de fuego', , 'Tras otro abominable verano con los Dursley, Harry se dispone a iniciar el cuarto curso en Hogwarts, la famosa escuela de magia y hechiceria. A sus catorce anos, a Harry le gustaria ser un joven mago como los demas y dedicarse a aprender nuevos sortilegios, encontrarse con sus amigos Ron y Hermione y asistir con ellos a los Mundiales de quidditch. Sin embargo, al llegar al colegio le espera una gran sorpresa que lo obligara a enfrentarse a los desafios mas temibles de toda su vida. Si logra superarlos, habra demostrado que ya no es un nino y que esta preparado para vivir las nuevas y emocionantes experiencias que el futuro le depara.', 2, 2);
INSERT INTO `libros` (`id`, `titulo`, `portada`, `descripcion`, `autores_id`, `cantidad`) VALUES
(5, 'Harry Potter y el misterio del principe', , 'Con dieciseis anos cumplidos, Harry inicia el sexto curso en Hogwarts en medio de terribles acontecimientos que asolan Inglaterra. Elegido capitan del equipo de Quidditch, los entrenamientos, los examenes y las chicas ocupan todo su tiempo, pero la tranquilidad dura poco. A pesar de los ferreos controles de seguridad que protegen la escuela, dos alumnos son brutalmente atacados. Dumbledore sabe que se acerca el momento, anunciado por la Profecia, en que Harry y Voldemort se enfrentaran a muerte: «El unico con poder para vencer al Senor Tenebroso se acerca... Uno de los dos debe morir a manos del otro, pues ninguno de los dos podra vivir mientras siga el otro con vida.». El anciano director solicitara la ayuda de Harry y juntos emprenderan peligrosos viajes para intentar debilitar al enemigo, para lo cual el joven mago contara con la ayuda de un viejo libro de pociones perteneciente a un misterioso principe, alguien que se hace llamar Principe Mestizo.', 2, 3);
INSERT INTO `libros` (`id`, `titulo`, `portada`, `descripcion`, `autores_id`, `cantidad`) VALUES
(6, 'The Adventures of Tom Sawyer', , 'The Adventures of Tom Sawyer by Mark Twain is an 1876 novel about a young boy growing up along the Mississippi River. It is set in the 1840s in the fictional town of St. Petersburg, inspired by Hannibal, Missouri, where Twain lived as a boy. In the novel Tom has several adventures, often with his friend, Huck. One such adventure, Tom\'s whitewashing of a fence, has been adapted into paintings and referenced in other pieces of popular culture. Originally a commercial failure[3] the book ended up being the best selling of any of Twain\'s works during his lifetime', 3, 2);

